import React from 'react';
import '../App/App.css';
import Banner from '../Banner/Banner';



class Home extends React.Component {
    render(){
        const homeInfo = {
            title: 'Home',
            path: '/',
            cName: 'nav-text',
            imageSrc: require('../images/profile.png'),
            name: 'home',
            thisIs: 'Chalida Pisuraj',
            descript: "Currently seeking full-time positions as a Software Engineer and UI/UX Designer/Engineer."
        }
        return (
            <div className='home'>
                <Banner 
                imageSrc = {homeInfo.imageSrc}
                thisIs = {homeInfo.thisIs}
                descript = {homeInfo.descript}/>
            </div>
        )
    }
}

export default Home;
